{'problem': 'What is the distance, in units, between the points $(2, -6)$ and $(-4, 3)$? Express your answer in simplest radical form.', 'ground_truth_solution': 'We use the distance formula:  \begin{align*}
\sqrt{(2 - (-4))^2 + ((-6) - 3)^2} &= \sqrt{6^2 + (-9)^2}\\
& = \sqrt{36 + 81}\\
& = \sqrt{117} = \boxed{3\sqrt{13}}.
\end{align*}', 'ground_truth_answer': '3\sqrt{13}', 'pre_generated_steps': ['I know that the distance between two points can be found using the Pythagorean theorem, which relates the distance to the horizontal and vertical differences between the points.', 'To find the horizontal difference, I can subtract the x-coordinates of the points: $2 - (-4) = 6$ units.', 'To find the vertical difference, I can subtract the y-coordinates of the points: $-6 - 3 = -9$ units.', "The distance, which I'll call d, is the hypotenuse of a right triangle with legs of length 6 and 9, so I can use the Pythagorean theorem to write: $d^2 = 6^2 + 9^2$.", 'Simplifying the equation, I get: $d^2 = 36 + 81 = 117$.', 'To find d, I need to take the square root of both sides: $d = \sqrt{117}$.', 'I notice that 117 is not a perfect square, but it has a factor of 9 that is a perfect square, so I can rewrite the radical as: $d = \sqrt{9 \cdot 13}$.', 'Using the property of radicals that says $\sqrt{ab} = \sqrt{a} \cdot \sqrt{b}$, I can simplify the radical further: $d = \sqrt{9} \cdot \sqrt{13} = 3 \cdot \sqrt{13}$.', '# Answer

$3 \cdot \sqrt{13}$ units'], 'pre_generated_answer': '$3 \cdot \sqrt{13}$ units', 'pre_generated_verifier_score': 0.0015123846039487379}

{'problem': 'Hillary has eleven coins, all dimes and nickels. In total, the coins are worth 75 cents. How many nickels does she have?', 'ground_truth_solution': 'Let the number of dimes Hillary has be $d$ and the number of nickels she has be $n$. We have the two equations \begin{align*}
d+n&=11\\
10d+5n&=75
\end{align*} (The last equation is in terms of cents.) To make the second equation nicer, we divide both sides by 5 to get $2d+n=15$. From the first given equation, we have $d=11-n$. Substituting this into the simplified second given equation to eliminate $d$, we get $2(11-n)+n=15\Rightarrow n=7$. Thus, Hillary has $\boxed{7}$ nickels.', 'ground_truth_answer': '7', 'pre_generated_steps': ["I want to find out how many nickels Hillary has, so I'll call that number x.", 'Then the number of dimes she has must be 11 - x, since she has eleven coins in total.', 'Each nickel is worth 5 cents, and each dime is worth 10 cents, so I can write an equation for the total value of the coins: 5x + 10(11 - x) = 75.', "I'll simplify this equation by multiplying out the parentheses and combining like terms: 5x + 110 - 10x = 75.", 'Subtracting 110 from both sides gives me: -5x = -35.', 'Dividing both sides by -5 gives me: x = 7.', 'This means Hillary has 7 nickels and 11 - 7 = 4 dimes.', '# Answer

7'], 'pre_generated_answer': '7', 'pre_generated_verifier_score': 0.2856583654067919}

