{'problem': 'What is the distance, in units, between the points $(2, -6)$ and $(-4, 3)$? Express your answer in simplest radical form.', 'ground_truth_solution': 'We use the distance formula:  \begin{align*}
\sqrt{(2 - (-4))^2 + ((-6) - 3)^2} &= \sqrt{6^2 + (-9)^2}\\
& = \sqrt{36 + 81}\\
& = \sqrt{117} = \boxed{3\sqrt{13}}.
\end{align*}', 'ground_truth_answer': '3\sqrt{13}', 'pre_generated_steps': ["I want to find the distance between these two points, so I'm going to use the distance formula, which says that the distance is equal to the square root of the difference in x-coordinates squared plus the difference in y-coordinates squared.", "So I'll plug in the given points into the formula.", 'The distance is equal to the square root of $(2 - (-4))^2 + (-6 - 3)^2$.', 'Simplifying the parentheses, I get the square root of $(2 + 4)^2 + (-9)^2$.', 'Squaring the terms inside the parentheses, I get the square root of $36 + 81$.', 'Adding those two numbers, I get the square root of $117$.', "Now I want to simplify the radical, so I'll look for factors of $117$ that are perfect squares.", 'The largest one I can find is $9$, which is $3^2$.', 'So I can rewrite the square root of $117$ as the square root of $9 \times 13$, which is the same as the square root of $9$ times the square root of $13$.', 'The square root of $9$ is $3$, so the distance is equal to $3 \sqrt{13}$ units.', '# Answer

3 \sqrt{13}'], 'pre_generated_answer': '3 \sqrt{13}', 'pre_generated_verifier_score': 0.3891349226838356}

